import React from "react";
import "../resource/styles/detailmessageuser.css";
import arownBack from "../resource/svg/chat/message/message/detailMessageUser/arownBack.svg";
import addGroup from "../resource/svg/chat/message/message/detailMessageUser/groupAdd.svg";
import avatar from "../resource/img/avatar.png";
import search from "../resource/svg/chat/message/message/detailMessageUser/search.svg";
import webcame from "../resource/svg/chat/message/message/detailMessageUser/webcame.svg";
import more from "../resource/svg/chat/message/more.svg";

function DetailMessageUser() {
  const data_user = {
    username: "Kim Young Jung",
    lastTime: "3 giờ",
  };

  return (
    <>
      <div className="contains-interface">
        <div className="header-container flex">
          <div className="left-header flex">
            <div className="flex">
              <img className="right-icon-arowback" src={arownBack} alt="" />
              <img className="right-img-avatar" src={avatar} alt="" />
            </div>
          </div>
          <div className="right-header flex">
            <img className="right-icon-group" src={addGroup} alt="add-group" />
            <img className="right-icon-search" src={search} alt="search" />
            <img className="right-icon-webcam" src={webcame} alt="webcam" />
          </div>
        </div>

        <div className="container"></div>

        <div className="footer-container"></div>
      </div>
    </>
  );
}

export default DetailMessageUser;
